import '../styles/main.css';
import '../styles/sign.css';
import '../styles/font-awesome.min.css';
import '../styles/bootstrap.min.css';
import '../styles/bootstrap-theme.css';
import '../styles/card.css';

const Topnav = () => {
  return (
    <><div className="navbar navbar-inverse navbar-fixed-top headroom">
      <div className="container">
        <div className="navbar-header">
          <button type="button" className="navbar-toggle" data-toggle="collapse" data-target=".navbar-collapse"><span
            className="icon-bar"></span> <span className="icon-bar"></span> <span className="icon-bar"></span> </button>
          <a class="navbar-brand" href="/">PreWedding</a>
        </div>
        <div id="navigationDrawer">
          <div class="navbar-collapse collapse">
            <ul class="nav navbar-nav pull-right">
              <li class="active"><a href="/">Home</a></li>
              <li><a href="/about">About</a></li>
              <li><a class="btn" href="/signin">SIGN IN / SIGN UP</a></li>
            </ul>
          </div>
        </div>
      </div>
    </div></>
  )
}

export default Topnav;
